  "inlineSchema": "// Simplified schema for SQLite development\ngenerator client {\n  provider = \"prisma-client-js\"\n}\n\ndatasource db {\n  provider = \"sqlite\"\n  url      = \"file:./dev.db\"\n}\n\n// User Management - Simplified\nmodel User {\n  id        String   @id @default(cuid())\n  email     String   @unique\n  firstName String\n  lastName  String\n  password  String\n  role      String   @default(\"EDUCATOR\") // STUDENT, EDUCATOR, ADMIN, SUPER_ADMIN\n  isActive  Boolean  @default(true)\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  courses         Course[]\n  documents       Document[]\n  documentFolders DocumentFolder[]\n  documentTags    DocumentTag[]\n  executions      AIAgentExecution[]\n  subscription    Subscription?\n  settings        UserSettings?\n\n  @@map(\"users\")\n}\n\n// Subscription - Simplified\nmodel Subscription {\n  id        String   @id @default(cuid())\n  userId    String   @unique\n  plan      String   @default(\"FREE\") // FREE, BASIC, PRO, ENTERPRISE\n  status    String   @default(\"ACTIVE\") // ACTIVE, CANCELED, PAST_DUE, TRIALING\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  user User @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@map(\"subscriptions\")\n}\n\n// Course Management - Simplified\nmodel Course {\n  id          String   @id @default(cuid())\n  title       String\n  description String?\n  authorId    String\n  status      String   @default(\"DRAFT\") // DRAFT, IN_PROGRESS, REVIEW, PUBLISHED, ARCHIVED\n  visibility  String   @default(\"PRIVATE\") // PRIVATE, INTERNAL, PUBLIC\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n\n  // Relations\n  author     User               @relation(fields: [authorId], references: [id])\n  documents  Document[]\n  executions AIAgentExecution[]\n\n  @@map(\"courses\")\n}\n\n// Document Management - Enhanced for Module B\nmodel Document {\n  id           String  @id @default(cuid())\n  title        String\n  description  String?\n  filename     String\n  originalName String\n  filePath     String\n  fileUrl      String? // Public URL for accessing the file\n  fileSize     Int\n  mimeType     String\n  type         String // PDF, DOCX, DOC, TXT, MD, IMAGE, VIDEO, AUDIO\n  status       String  @default(\"UPLOADING\") // UPLOADING, PROCESSING, READY, ERROR, DELETED\n  ownerId      String\n  courseId     String?\n  folderId     String?\n\n  // Content Analysis\n  extractedText String? // AI-extracted text content\n  summary       String? // AI-generated summary\n  keywords      String? // JSON array of extracted keywords\n  language      String? // Detected language\n  metadata      String? // JSON metadata (page count, dimensions, etc.)\n\n  // Processing Info\n  processingError String? // Error message if processing failed\n  downloadCount   Int       @default(0)\n  lastAccessedAt  DateTime?\n\n  // Security\n  isPublic    Boolean @default(false)\n  accessLevel String  @default(\"OWNER\") // OWNER, COURSE, ORGANIZATION, PUBLIC\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  owner        User                  @relation(fields: [ownerId], references: [id])\n  course       Course?               @relation(fields: [courseId], references: [id])\n  folder       DocumentFolder?       @relation(fields: [folderId], references: [id])\n  tagRelations DocumentTagRelation[]\n\n  @@map(\"documents\")\n}\n\n// Document Folders for organization\nmodel DocumentFolder {\n  id          String   @id @default(cuid())\n  name        String\n  description String?\n  ownerId     String\n  parentId    String?\n  courseId    String?\n  color       String? // Hex color for visual organization\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n\n  // Relations\n  owner     User             @relation(fields: [ownerId], references: [id])\n  parent    DocumentFolder?  @relation(\"FolderHierarchy\", fields: [parentId], references: [id])\n  children  DocumentFolder[] @relation(\"FolderHierarchy\")\n  documents Document[]\n\n  @@map(\"document_folders\")\n}\n\n// Document Tags for better organization\nmodel DocumentTag {\n  id        String   @id @default(cuid())\n  name      String\n  color     String? // Hex color for the tag\n  ownerId   String\n  createdAt DateTime @default(now())\n\n  // Relations\n  owner        User                  @relation(fields: [ownerId], references: [id])\n  tagRelations DocumentTagRelation[]\n\n  @@unique([name, ownerId]) // Unique tag names per user\n  @@map(\"document_tags\")\n}\n\n// Many-to-many relation between Documents and Tags\nmodel DocumentTagRelation {\n  documentId String\n  tagId      String\n\n  document Document    @relation(fields: [documentId], references: [id])\n  tag      DocumentTag @relation(fields: [tagId], references: [id])\n\n  @@id([documentId, tagId])\n  @@map(\"document_tag_relations\")\n}\n\n// AI Agents - Core for Module D\nmodel AIAgent {\n  id           String   @id @default(cuid())\n  type         String   @unique // ARCHITECT, RESEARCH, WRITING, EDITING, DESIGN, QUALITY, MARKETING\n  name         String\n  description  String\n  capabilities String // JSON string for array of capabilities\n  systemPrompt String\n  model        String   @default(\"gpt-4\")\n  temperature  Float    @default(0.7)\n  maxTokens    Int      @default(2000)\n  isEnabled    Boolean  @default(true)\n  createdAt    DateTime @default(now())\n  updatedAt    DateTime @updatedAt\n\n  // Relations\n  executions AIAgentExecution[]\n\n  @@map(\"ai_agents\")\n}\n\n// AI Agent Executions\nmodel AIAgentExecution {\n  id          String    @id @default(cuid())\n  agentType   String\n  courseId    String?\n  userId      String\n  input       String // JSON string for input data\n  output      String? // JSON string for output data\n  status      String    @default(\"PENDING\") // PENDING, RUNNING, COMPLETED, FAILED, CANCELED\n  startedAt   DateTime  @default(now())\n  completedAt DateTime?\n  duration    Int? // in milliseconds\n  cost        Float? // in USD\n\n  // Relations\n  agent  AIAgent @relation(fields: [agentType], references: [type])\n  course Course? @relation(fields: [courseId], references: [id])\n  user   User    @relation(fields: [userId], references: [id])\n\n  @@map(\"ai_agent_executions\")\n}\n\n// User Settings for API Keys and LLM Configurations\nmodel UserSettings {\n  id        String   @id @default(cuid())\n  userId    String   @unique\n  settings  String // JSON string containing encrypted API keys and preferences\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  // Relations\n  user User @relation(fields: [userId], references: [id], onDelete: Cascade)\n\n  @@map(\"user_settings\")\n}\n\n// LLM Provider Configurations\nmodel LLMProvider {\n  id          String   @id @default(cuid())\n  name        String   @unique // openai, deepseek, claude, gemini, etc.\n  displayName String // \"OpenAI GPT-4\", \"DeepSeek Chat\", etc.\n  baseUrl     String? // API base URL (for custom endpoints)\n  models      String // JSON array of available models\n  pricing     String? // JSON object with pricing info\n  features    String // JSON array of supported features\n  authType    String // API_KEY, BEARER_TOKEN, etc.\n  isEnabled   Boolean  @default(true)\n  isDefault   Boolean  @default(false)\n  createdAt   DateTime @default(now())\n  updatedAt   DateTime @updatedAt\n\n  @@map(\"llm_providers\")\n}\n",
